import React from 'react';
import MenuBar from '../../Components/MenuBar/menubar.jsx';
import "../../Components/MenuBar/menubar.css";
import applyCertificate from "react-icons/pi";
import { TbStatusChange } from "react-icons/tb";
import { IoMdHelp } from "react-icons/io";
import './dashboard.css';
import Tile from "../../Components/Tile/tile.jsx"

const Dashboard = () => {
  return (
    <div>
      <MenuBar />
      <div className="main-container"> {/* Added a wrapper div with class "big-box" */}
        <div className="menu-container">
            <Tile text="Tile 1" image={applyCertificate} onClick={handleTileClick} />
          <Tile text="Check Status" icon={<TbStatusChange className="tile-icon" />} />
          <Tile text="Help" icon={<IoMdHelp className="tile-icon" />} />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
